import React,{Component} from 'react';
import AOS from 'aos';
import "aos/dist/aos.css";

class Workleft extends Component {


  componentDidMount() {
    AOS.init({
      offset: 200,
      duration: 600,
      easing: 'ease-in-sine',
      delay: 100,
    });
  }




  render() {
    return (
      <div>
        <div class="workleft" data-aos="fade-left">
          <h1>{this.props.title}</h1>
          <p>
            {this.props.detail}
          </p>
          <a href={this.props.link}>VIEW</a>
        </div>
        
      </div>
    )
  }
}

export default Workleft
